import React from 'react';
import cartIcon from "../resource/carticon.png";
import {Link} from 'react-router-dom';

export function Navbar() {
    return (
    <nav className="navbar">
        <ul className="nav-links">
            <li><Link to="/">Kezdőoldal</Link></li>
            <li><Link to="/Supplements">Táplálékkiegészítők</Link></li>
            <li><a href='#machines'>Gépek</a></li>
            <li><a href='#additional'>Kiegészítők</a></li>
        </ul>
        <ul className="nav-links right">
            <li><a href="#cart" className='cart-icon'><img src={cartIcon} alt="Kosár" /></a></li>
            <li><a href="#login">Bejelentkezés</a></li>
            <li><a href="#register">Regisztráció</a></li>
        </ul>
    </nav>
      );
};
